import React, { useState, useEffect } from 'react';
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend,
  TimeScale
} from 'chart.js';
import { Line } from 'react-chartjs-2';
import 'chartjs-adapter-date-fns';

// Register Chart.js components
ChartJS.register(
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend,
  TimeScale
);

// Utility functions
const calculateHVACReduction = (value) => value * 0.7;
const calculateEcologicaReduction = (value) => value * 0.6;
const calculateCombinedReduction = (value) => value * 0.5;

const calculateAnxietyRisk = (baseLevel, pm10) => {
  if (pm10 >= 10) {
    const increase = pm10 / 10;
    const riskIncrease = increase * 0.12; // 12% increase per 10mg
    return Math.min(10, baseLevel * (1 + riskIncrease));
  }
  return baseLevel;
};

const DatasetToggle = ({ name, isActive, onToggle, color }) => (
  <div style={{ display: 'flex', alignItems: 'center', margin: '5px 0' }}>
    <button
      onClick={() => onToggle(name)}
      style={{
        width: '20px',
        height: '20px',
        borderRadius: '50%',
        border: `2px solid ${color}`,
        backgroundColor: isActive ? color : 'white',
        cursor: 'pointer',
        marginRight: '8px',
        padding: 0
      }}
    />
    <span style={{ fontSize: '0.9rem' }}>{name}</span>
  </div>
);

const AnxietyRiskChart = ({ userPreferences }) => {
  const [data, setData] = useState([]);
  const [isLoading, setIsLoading] = useState(true);
  const [error, setError] = useState(null);
  const [activeDatasets, setActiveDatasets] = useState({
    'Baseline Anxiety Risk': true,
    'Anxiety Risk with Your Preferences': true
  });

  const toggleDataset = (name) => {
    setActiveDatasets(prev => ({
      ...prev,
      [name]: !prev[name]
    }));
  };

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await fetch('http://localhost:5000/api/airqualitydata');
        if (!response.ok) {
          throw new Error('Failed to fetch air quality data');
        }
        const rawData = await response.json();
        setData(rawData);
      } catch (err) {
        setError(err.message);
      } finally {
        setIsLoading(false);
      }
    };

    fetchData();
  }, []);

  if (isLoading) return <div>Loading anxiety risk data...</div>;
  if (error) return <div>Error loading anxiety risk data: {error}</div>;
  if (!data.length) return <div>No anxiety risk data available</div>;

  const { hasHVAC, hasEcologica, anxietyLevel = 5 } = userPreferences;

  const chartData = {
    datasets: [
      {
        label: 'Baseline Anxiety Risk',
        data: data.map(d => ({
          x: new Date(d.created_at),
          y: calculateAnxietyRisk(anxietyLevel, parseFloat(d['PM 10']))
        })),
        borderColor: 'rgb(0, 100, 0)',
        backgroundColor: 'rgba(0, 100, 0, 0.1)',
        borderWidth: 2,
        tension: 0.1,
        hidden: !activeDatasets['Baseline Anxiety Risk']
      },
      ...(hasHVAC || hasEcologica ? [{
        label: 'Anxiety Risk with Your Preferences',
        data: data.map(d => {
          const reducedPM10 = hasHVAC && hasEcologica
            ? calculateCombinedReduction(parseFloat(d['PM 10']))
            : hasHVAC
              ? calculateHVACReduction(parseFloat(d['PM 10']))
              : calculateEcologicaReduction(parseFloat(d['PM 10']));
          return {
            x: new Date(d.created_at),
            y: calculateAnxietyRisk(anxietyLevel, reducedPM10)
          };
        }),
        borderColor: 'rgb(144, 238, 144)',
        backgroundColor: 'rgba(144, 238, 144, 0.1)',
        borderWidth: 2,
        tension: 0.1,
        hidden: !activeDatasets['Anxiety Risk with Your Preferences']
      }] : [])
    ]
  };

  const options = {
    responsive: true,
    maintainAspectRatio: false,
    scales: {
      x: {
        type: 'time',
        time: {
          unit: 'day',
          displayFormats: {
            day: 'MMM d'
          }
        },
        title: {
          display: true,
          text: 'Date'
        }
      },
      y: {
        beginAtZero: true,
        max: 10,
        title: {
          display: true,
          text: 'Anxiety Risk Level'
        }
      }
    },
    plugins: {
      legend: {
        display: false
      },
      tooltip: {
        mode: 'index',
        intersect: false,
        callbacks: {
          label: (context) => {
            const label = context.dataset.label;
            const value = context.raw.y.toFixed(1);
            return `${label}: ${value}`;
          }
        }
      }
    }
  };

  return (
    <div className="content-wrapper">
      <div className="chart-side">
        <div style={{ height: '400px', width: '100%' }}>
          <Line data={chartData} options={options} />
        </div>
        <div style={{ 
          marginTop: '20px',
          display: 'flex',
          gap: '20px',
          justifyContent: 'center'
        }}>
          <DatasetToggle 
            name="Baseline Anxiety Risk" 
            isActive={activeDatasets['Baseline Anxiety Risk']} 
            onToggle={toggleDataset}
            color="rgb(0, 100, 0)"
          />
          {(hasHVAC || hasEcologica) && (
            <DatasetToggle 
              name="Anxiety Risk with Your Preferences" 
              isActive={activeDatasets['Anxiety Risk with Your Preferences']} 
              onToggle={toggleDataset}
              color="rgb(144, 238, 144)"
            />
          )}
        </div>
      </div>

      <div className="data-side">
        <div className="key-data-title">
          KEY DATA POINTS
        </div>
        <div className="key-data-points">
          <div className="key-data-point">
            <span className="key-data-number">
              {anxietyLevel.toFixed(1)}
            </span>
            <span className="key-data-label">
              Base<br />Level
            </span>
          </div>
          <div className="key-data-point">
            <span className="key-data-number">
              {data.filter(day => 
                calculateAnxietyRisk(anxietyLevel, parseFloat(day['PM 10'])) > anxietyLevel
              ).length}
            </span>
            <span className="key-data-label">
              Days with<br />Increased Risk
            </span>
          </div>
          <div className="key-data-point">
            <span className="key-data-number">
              {Math.max(...data.map(day => 
                calculateAnxietyRisk(anxietyLevel, parseFloat(day['PM 10']))
              )).toFixed(1)}
            </span>
            <span className="key-data-label">
              Peak<br />Level
            </span>
          </div>
        </div>
      </div>
    </div>
  );
};

export default AnxietyRiskChart;
